<!DOCTYPE html>

<html>
  <head>
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1">
    <script type="module" src="./elevation-profile.ts"></script>
    <style>
      body {
        margin: 0;
      }
      .container {
        position: relative;
        margin: 50px;
      }

      #tooltip {
        display: none;
        position: absolute;
        background-color: #707070;
        color: #fff;
        padding: 10px;
        transform: translate(-50%, -100%);
      }

      elevation-profile {
        display: block;
        width: 80%;
        height: 300px;
      }

      elevation-profile .grid.x {
        display: none;
      }

      elevation-profile line {
        shape-rendering: crispEdges;
      }

      elevation-profile .axis .domain, .grid .domain {
        display: none;
      }

      elevation-profile .axis line, .grid line {
        stroke: #707070;
      }

      elevation-profile .pointer-line {
        stroke: #707070;
        stroke-opacity: 0.3;
        stroke-width: 2;
        stroke-dasharray: 3, 3;
      }

      elevation-profile .pointer-circle {
        fill: #3761a4;
        stroke: #fff;
        stroke-width: 3;
      }
      elevation-profile .pointer-circle-outline {
        fill: #000;
        fill-opacity: 0.2;
      }

      elevation-profile .elevation, elevation-profile .elevation.highlight {
        stroke: #3761a4;
        stroke-width: 2;
        stroke-linejoin: round;
      }
      elevation-profile .elevation.highlight {
        stroke-width: 3;
      }

      elevation-profile .area {
        fill: #e6e6e6;
        fill-opacity: 0.85;
      }

      elevation-profile .point {
        fill: #F2000C;
        stroke: #fff;
        stroke-width: 3;
      }

    </style>
  </head>
